import { ReactDOM } from "react";
import React from "react";
import '../App.css';
function Keyboard(props){
  
    return (
      <div className="keyboard">
           <button  value="1" onClick={props.onButtonPressed}>1</button>
           <button  value="2"onClick={props.onButtonPressed}>2</button>
           <button  value="3"onClick={props.onButtonPressed}>3</button>
           <button  value="+" onClick={props.onButtonPressed}>+</button>
           <button  value="4"onClick={props.onButtonPressed}>4</button>
           <button value="5"onClick={props.onButtonPressed}>5</button>
           <button  value="6"onClick={props.onButtonPressed}>6</button>
           <button  value="-"onClick={props.onButtonPressed}>-</button>
           <button  value="7"onClick={props.onButtonPressed}>7</button>
           <button  value="8"onClick={props.onButtonPressed}>8</button>
           <button  value="9"onClick={props.onButtonPressed}>9</button>
           <button  value="*"onClick={props.onButtonPressed}>*</button>
           <span></span>
           <button  value="0"onClick={props.onButtonPressed}>0</button>
           <button  value="="onClick={props.onButtonPressed}>=</button>
           <button  value="/"onClick={props.onButtonPressed}>/</button>
           
           </div>
    )
}

export default Keyboard ;
